# ## AUC ROC (площадь под кривой ROC)

# %% [markdown] id="LRFQtfBOx4HR"
# Площадь под ROC-кривой – одна из самых популярных метрик в задачах бинарной классификации. Но прежде чем перейти к ее рассмотрению, необходимо вспомнить, что такое матрица ошибок и как с ее помощью построить ROC-кривую. Далее необходимо найти площадь под кривой ROC c помощью интегрирования (для этого необходимо вспомнить школьный курс алгебры 11 класс). Хорошо, что у нас есть библиотека `sklearn`, которая все сделает за нас. И так приступим!

