# На рис. 1 показана матрица ошибок — это комбинация вашего прогноза (1 или 0) и фактического значения (1 или 0). В зависимости от результата предсказания и того, корректна ли была проведена классификация, матрица разделена на 4 части. Например, `true positive` (истинно-положительный) результат — это количество случаев, в которых вы правильно классифицируете пример как положительный. А `false positive` (ложно-положительный, или ошибка первого рода) — это число случаев, в которых вы ошибочно классифицируете пример как положительный. Это можно сравнить с ошибкой врача, когда совершенно здоровый человек сдает анализ на наличие заболевания, и ему сообщают о положительном результате (пациент - болен)! Хотя это сложно назвать положительным результатом!
