# %% [markdown] id="9rjOIHSS8DKC"
# На рис. 2. показано, как ошибки первого рода (ложно-положительные) могут приводить к комическим ситуациям.

# %% [markdown] id="KKkYmDpA2Xr8"
#
#
# Матрица ошибок содержит только абсолютные числа. Однако, используя их, мы можем получить множество других метрик, основанных на процентных соотношениях. **True Positive Rate** (`TPR`) и **False Positive Rate** (`FPR`) — две из них.
#
#
# **True Positive Rate** (`TPR`) показывает, какой процент среди всех `positive` верно предсказан моделью:
# ```
# TPR = TP / (TP + FN)
# ```
#
# **False Positive Rate** (`FPR`) показывает, какой процент среди всех `negative` неверно предсказан моделью:
# ```
# FPR = FP / (FP + TN)
# ```
#
# где `TP` - истинно-положительные, `FN` - ложно-отрицательные, `TN` - истинно-отрицательные и `FP` - ложно-положительные результаты.

# %% [markdown] id="wAtsv1J3JLtC"
# Еще раз для закрепления.
# **True Positive Rate** (`TPR`) - какая часть из "положительных" классификаций оказалась верна. Например, модель предсказала, что пациенты A, B, C больны. Какая часть из них больна на самом деле?
#
# **False Positive Rate**  (`FPR`) - какая часть из "негативных" классификаций оказалась неверна. Иными словами, модель предсказала, что A, B, C здоровы. Какая часть из них на самом-то деле больна?

# %% [markdown] id="I7q3Dnyv8idF"
# ### Что такое ROC-кривая?

# %% [markdown] id="UhUb0JgP2XpI"
# ![image.png](data:image/png;base64,)

# %% [markdown] id="jnfCGqdJyL17"
# Как вы видеть на графике, кривая ROC — это зависимость TPR от FPR. Как же получить эту зависимость?
#
# В общем случае при решении задачи бинарной классификации нам хотелось бы получать предсказания модели, которые соответствуют "вероятности" того, что объект относится к тому или иному классу.
#
# То есть информация от модели "клиент не вернёт кредит" менее ценна, чем "клиент не вернёт кредит с вероятностью 99%" или "клиент не вернёт кредит с вероятностью 32%". В случае с предсказанием без вероятности мы не можем быть уверены, как сильно стоит доверять модели, а когда модель сообщает нам степень собственной уверенности, мы можем самостоятельно заниматься оценкой рисков.
#
# Работа с рисками может быть довольна важна в случаях, когда "лучше перебдеть". Если Ваша модель меньше чем на 99% уверена в том, что у пациента нет рака, то лучше отправить пациента на дополнительные обследования. Но почему я в качестве порога я выбрал именно 99%? Может, лучше поставить 98% или 95%? Для выбора этого порога как раз-таки и может быть использована ROC-кривая. Что она из себя представляет?
#
# При построении ROC-кривой, постепенно перебираются различные варианты "порога", по которому объект относится к положительному либо негативному классу (тот самый порог, о котором сомневались выше - 95%, 98% или 99%). В зависимости от порога, часть объектов попадает в предсказание, как относящиеся к положительному классу, другая часть - как относящиеся к отрицательному классу. На каждом из возможных разбиений (от порога в 0% до порога в 100%) мы можем посчитать как TPR, так и FPR. И, для каждого из разбиений, мы можем отложить точку на графике зависимости TPR от FPR - соединив их, мы и получим ROC-кривую.
#
# **Как выбрать оптимальную точку на кривой ROC?**
#
# Трудно определить оптимальную точку, потому что нужно выбрать наиболее подходящее пороговое значение, учитывая сферу применения модели. Однако общее правило — максимизировать разницу (TPR-FPR), которая на графике представлена вертикальным расстоянием между оранжевой и синей пунктирной линией.

# %% [markdown] id="QMssa9tjUfB9"
# Чем больше площадь под кривой (AUC), тем лучше классификация. Идеальная или наилучшая кривая — это вертикальная линия от $(0,0)$ до $(0,1)$, и горизонтальная от $(0,1)$ до $(1,1)$. Это означает, что модель всегда может различить положительные и отрицательные случаи. Однако, если вы выбираете класс случайным образом для каждого примера, TPR и FPR должны увеличиваться с одинаковой скоростью.
#
# Синяя пунктирная линия показывает кривую TPR и FPR при случайном определении positive или negative для каждого случая. Для этой диагональной линии площадь под кривой (AUC) составляет 0.5.

# %% [markdown] id="EEkaVsiXb6EJ"
# ### AUC (площадь под кривой ROC)

# %% [markdown] id="18DsLIKWb-xG"
# **Почему площадь под кривой ROC – хорошая метрика для оценки модели классификации?**
#
# Хорошая метрика модели машинного обучения должна отображать истинную и постоянную способность модели к прогнозированию. Это означает, что, если изменить тестовый набор данных, то он не должен давать другой результат.
#
# ROC-кривая учитывает не только результаты классификации, но и вероятность предсказания всех классов. Например, если результат корректно классифицирован на основе 51% вероятности, то он, скорее всего, будет классифицирован неверно, если вы воспользуетесь другим тестовым датасетом. Кроме того, ROC-кривая также учитывает эффективность модели при различных пороговых значениях. Она является комплексной метрикой для оценки того, насколько хорошо разделяются случаи в разных группах.
#
# **Какое значение AUC является приемлемым для модели классификации?**
#
# Для задачи двоичной классификации при определении классов случайным образом, вы можете получить  $AUC = 0.5$. Следовательно, если вы решаете задачу бинарной классификации, разумное значение $AUC > 0.5$. У хорошей модели классификации показатель $AUC > 0.9$, но это значение сильно зависит от сферы ее применения.

