# **Ну и конечно же, какое программирование и без кода?**
#
# Вопрос вполне справедливый. Построим с помощью библиотеки `sklearn` простую модель логистической регрессии.
#
# Итак, мы уже знаем, что с помощью регрессии осуществляется прогноз. На входе – признаки объектов выборки, на выходе – вещественное число (стоимость товара, ожидаемая прибыль и т. д.).
#
# Логистическая регрессия, как и линейная (с ней уже мы знакомы, см. урок [Математический аппарат обучения нейронных сетей](https://colab.research.google.com/drive/1FtyyBXYq9FaOEknvu4ghim-ejuO_3aIZ#scrollTo=eSmD6Tf33TUr)), была заимствована из статистики. Отличительной чертой логистической регрессии является то, что значением функции является вероятность.
#
# **Вероятность чего?**
#
# Закономерный вопрос. Давайте обо всем по порядку.
#
# На входе логистическая регрессия, как и линейная, принимает одну или несколько независимых переменных (признаков набора данных) и подсчитывает их взаимосвязь с зависимой переменной. Различие в том, что логистическая регрессия применяет сигмоидную функцию (также известна как логистическая, или logit-функция), которая позволяет предсказывать непрерывную переменную со значениями на отрезке $[0, 1]$ при любых значениях независимых переменных. Фактически это распределение Бернулли (для тех, кому это интересно).
#
# Теперь наступает время ответить на вопросы, поставленные выше.
#
# Логистическая регрессия вычисляет вероятность того, что данное исходное значение принадлежит к определенному классу. Она используется для задач классификации: оценивает вероятности принадлежности данного объекта к тому или иному классу.
#

